import React, { Component } from 'react'
import './RegisterPage.css'

export class RegisterPage extends Component {
    constructor() {
        super();
        this.tabs = document.getElementsByClassName('register-tabs')[0].getElementsByTagName('p');
        this.contents = document.getElementsByClassName('register-contents')[0].getElementsByTagName('p');
        this.state = {

        }
    }

    changeTab = tab => {
        for (var i = 0, len = tabs.length; i < len; i++){
            this.tabs[i].onmouseover = showTab;
        }
    };

    showTab = () => {
        for (var i = 0, len = tabs.length; i < len; i++){
            if(tabs[i] === this){
                this.tabs[i].className = 'selected-tab';
                this.contents[i].className = 'show';
            } else {
                this.tabs[i].className = '';
                this.contents[i].className = '';
            }
        }
    };

    render() {
        return (
            <div className = 'register-page'>
                <div className='login-background'>
                    <img
                        className='login-img'
                        alt='background'
                        src='https://pacificahousing.ca/wp-content/uploads/2016/11/1213-small-4965.jpg'
                    />
                </div>
                <div className = 'login-box register-box'>
                    <p className = 'login-title'>
                        Register
                    </p>
                    <div className = 'register-tabs'>
                        <p className='selected-tab'>As Guest</p>
                        <p>As Host</p>
                    </div>
                    <div>
                        <div className='show'>
                            <input className = 'login-input register-fn-input'
                            name='firstName'
                            type='name'
                            placeholder='First Name'/>
                            <input className = 'login-input register-fn-input'
                            name='lastName'
                            type='name'
                            placeholder='Last Name'/>
                            <input className = 'login-input register-fn-input'
                            type='email'
                            placeholder='Email Address'/>
                        </div>
                    </div>
                    <div>
                        <button
                            type='submit'
                            className='submitButton'
                        >
                            Register
                        </button>
                    </div>
                </div>
            </div>
        )
    }
}

export default RegisterPage
